import styled from 'styled-components';
import {ArrowBack} from '@styled-icons/evaicons-solid/ArrowBack'

const BackButton = styled(ArrowBack)`
	height: 30px;
	width: 30px;
	position: fixed;
	top: 1em;
	left: 1em;
`

export default BackButton;
